import React, { Component } from "react";
import ReactDOM from "react-dom";
import SignIn from "./components/signIn";
import SignUp from "./components/signUp";
// import IndexComponents from "./components/indexComponents";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Nav from "./components/navbar/navBar";
import Homepage from "./components/home/Homepage";
import Footer from "./components/footer";
import ForgotPassword from "./components/forgotPassword";
import Tournament from "./components/tournament";
import Guide from "./components/guide";
import Help from "./components/help";
import Dashboard from "./components/dashboard";

import "./App.css";

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="appPosition">
          <Router>
            <Switch>
              <Route path="/dashboard">
                <Dashboard />
              </Route>
              {/* <Route exact path="/dashboard/user">
                <Dashboard />
              </Route>
              <Route exact path="/dashboard/player">
                <Dashboard />
              </Route>
              <Route exact path="/dashboard/tournament">
                <Dashboard />
              </Route>
              <Route exact path="/dashboard/tournament/create">
                <Dashboard />
              </Route> */}
              {/* <Route path="/dashboard/tournament/edit/:id">
                <Dashboard />
              </Route> */}
              {/* <Route path="/dashboard/tournament/edit/">
                <Dashboard />
              </Route> */}
              {/* <Route exact path="/dashboard/gameServer">
                <Dashboard />
              </Route> */}
              <Route exact path="/signIn">
                <SignIn />
              </Route>
              <Route exact path="/signUp">
                <SignUp />
              </Route>
              <Route exact path="/forgotPassword">
                <ForgotPassword />
              </Route>
              <>
                <Nav />
                <Route exact path="/">
                  <Homepage />
                </Route>
                <Route exact path="/tournament">
                  <Tournament />
                </Route>
                <Route exact path="/tournament/finished">
                  <Tournament />
                </Route>
                <Route exact path="/help">
                  <Help />
                </Route>
                <Route exact path="/guide">
                  <Guide />
                </Route>

                <Footer />
              </>
            </Switch>
            <Switch></Switch>
          </Router>
        </div>
      </div>
    );
  }
}

export default App;

if (document.getElementById("root")) {
  ReactDOM.render(<App />, document.getElementById("root"));
}
